import { Container, Stack, Box, Typography, TextField, Button } from '@mui/material';
import React, { useState } from 'react';
import { useSearchParams } from 'react-router-dom';

const Header = (props) => (
<Box sx={{ 
    position: "absolute", 
    width: "100%", 
    backdropFilter: "blur(10px)", 
    padding: "10px", 
    backgroundColor: "rgba(225, 225, 225, 0.5)", 
    boxShadow: "-4px 9px 25px -6px rgba(0, 0, 0, 0.2)" 
}}>
    {props.children}
</Box>
);

const Query = () => {
  let [searchParams, _] = useSearchParams();
    return (
        <Box sx={{ display: "flex" }} >
            <Box sx={{ p: 0, backgroundColor: "red", width: "20vw", height: "100vw", borderRight: "1px solid #dedede"}}>
                <Header>Repositories</Header>
                aaa
            </Box>
            <Box sx={{ display: "flex", width: "80vw", height: "100vw" }}>
                <Box sx={{ position: "absolute", width: "100%", backdropFilter: "blur(10px)", padding: "10px", backgroundColor: "rgba(225, 225, 225, 0.5)", boxShadow: "-4px 9px 25px -6px rgba(0, 0, 0, 0.2)" }}>
                    Query <b>{searchParams.get("repo")}</b>
                </Box>
                <Container sx={{ backgroundColor: "green", width: "55vw", height: "100vw" }}>
                    aaa
                </Container>
                <Container sx={{ backgroundColor: "blue", width: "25vw", height: "100vw" }}>
                    aaa
                </Container>
            </Box>
        </Box>
    );
}

export default Query;
